import React, { useEffect, useState } from "react"
import { Button } from "react-bootstrap";
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import MapView from './MapView';

import Card from 'react-bootstrap/Card';
import axios from "axios";

const DnsSearcher = ({editarLista}) => {    

  const  [busqueda , agregarabusqueda] = useState( {txtbusqueda:""})
  const  [estado,setEstado] =useState("vacio");
  const  [IPNet , CambiarIP] = useState({IP: "",websiteName:"",country:"",isp:"",org:"",lat:"",lon:"",img:""});
  const  [build , buildchange] = useState([[]]);

  const {txtbusqueda} = busqueda;
  const {IP,websiteName,country, isp, org ,lat,lon,img} = IPNet;


  const handleChange = (e) => { 

    agregarabusqueda({
      ...busqueda,
        [e.target.name] : e.target.value
    })
  }


  const submitForm=(e)=>{
    e.preventDefault();
    editarLista(txtbusqueda);
    setEstado("")
    console.log(validarUrl(busqueda));
    if(validarUrl(busqueda)){
      DnsLookup(txtbusqueda);
      obtenerDireccionIP(txtbusqueda); 
      console.log(build)
    }
  }

  function validarUrl(busqueda){

    return true;
  }


  useEffect(()=>{
              setEstado("validado");
          },[IP,build] )



  const  obtenerDireccionIP = async(busqueda) => {
    try {
      const response = await fetch(`http://ip-api.com/json/${busqueda.replace("https://", "").replace("http://", "").replace("www.", "")}`);
      const data = await response.json();
      if (data.status === 'success') {

        CambiarIP({IP:    data.query,
                  websiteName: txtbusqueda,
                  country:data.country,
                  isp:    data.isp,
                  org:    data.org,
                  lat:    data.lat,
                  lon:    data.lon,
                  img: build})
        return;

      } else {
        console.error('Error al obtener la dirección IP:', data.message);
        setEstado("error")
        return null;
      }
    } catch (error) {
      console.error('Error al obtener la dirección IP:', error);
      setEstado("error")
      return null;
    }
  }
  const DnsLookup =  async(url) => {

    var myHeaders = new Headers();
    myHeaders.append("key", "0D3C91D418AD36C7DB93D2B80AC06229");

    try{
      const response = await axios.get(
        `https://api.savepage.io/v1/?key=09e97082bee4babfd4ee0d3f1cdae752&q=${url.replace("https://", "").replace("http://", "").replace("www.", "")}`)

      console.log(response);
      const data = await response.json()
      buildchange(data)

    }
    catch(e){
      console.log(e)
    }
  }

    return(
      <>
        <Form onSubmit={submitForm}>
            <div className="row">
              <div className="col-md-8 col-sm-12">
              <InputGroup className="mb-3">
              <InputGroup.Text >Web a buscar:</InputGroup.Text>
                <Form.Control
                  type="text"
                  placeholder="ingrese una url para escanear"
                  name="txtbusqueda"
                  onChange={handleChange}
                  value={txtbusqueda}/>
              </InputGroup>
            </div>
            <div className="col-md-4 col-sm-12"  >
                <Button type="submit" variant="primary">Buscar</Button>
              </div>
            </div>
        </Form>
        {estado ==="error"? 
                    <h2> la pagina ingresada es invalida</h2>
              : estado==="validado" && IP !== ''? 
                    <div className="row">                   
                      <div className="col-md-6">
                        <Card>
                          <Card.Header as="h5">{websiteName}</Card.Header>
                          <Card.Body>
                            <Card.Title>IP:{IP}</Card.Title>
                            <Card.Text>
                            <b>country:</b> {country}<br></br>
                            <b>isp:</b> {isp}<br></br>
                            <b>org:</b> {org}<br></br>
                            <b>lat:</b> {lat}<br></br>
                            <b>lon:</b> {lon}<br></br>
                            </Card.Text>
                          </Card.Body>
                        </Card>
                        <img id="ItemPreview" src={ "data:image/jpeg;base64," + img}   ></img>
                      </div>
                      <div className="col-md-6">
                        <MapView ip={IP} 
                                lat={lat}
                                lon={lon} /> 
                      </div>
                    </div>

                    :null
        }
      </>
      )
}

export default DnsSearcher;
